import React, { Component } from 'react';
import '../sass/styles.css';
import gif from '../prenuvo_db/862625ef/1361ae6e/bw-gif.gif'


export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      error: false,
    };
  }

  onImgLoad = ({ target: img }) => {
    this.setState({
      width: img.width,
      height: img.height,
    });
  };

  render() {
    const { image, alt } = this.props;
    const { width, height, error } = this.state;
    console.log(width, height, error);
    return (
      <div>
       <h1>IMAGES</h1> 
        <div>
          <img src={gif} onLoad={this.onImgLoad} alt="prenuvo" />
        </div>

      </div>
    )
  }
}
